angular.module("eKart",['ngRoute'])
        .config(config)
        .controller('navCtrl',navCtrl)
        .controller('productCtrl',productCtrl)
        .controller('aboutCtrl',aboutCtrl)
        .controller('detailCtrl',detailCtrl)
        .controller('cartCtrl',cartCtrl)
        .controller('addCtrl',addCtrl)
        .factory('products',products)
        .factory('kart',kart)
        .factory('newprod',newprod)
        .factory('anotherprod',anotherprod)
      
       


function config($routeProvider){

    $routeProvider
   
    .when("/category/:category",{
        templateUrl:'partials/home.html',
        controller:'productCtrl',
        controllerAs:'product'
    })
     
    .when("/add",{
        templateUrl:'partials/add.html',
        controller:'addCtrl',
        controllerAs:'add'
    })
    
    .when("/another",{
        templateUrl:'partials/another.html',
        controller:'addCtrl',
        controllerAs:'add'
    })

    .when("/category/:category/product/:product",{
        templateUrl:'partials/product.html',
        controller:'detailCtrl',
        controllerAs:'detail'
    })
    .when("/category/:category/:brand",{
        templateUrl:'partials/product.html',
        controller:'productCtrl',
        controllerAs:'product'
    })
    .when("/about",{
        templateUrl:'partials/about.html',
        controller:'aboutCtrl',
        controllerAs:'about'
    })
    .when("/cart",{
        templateUrl:'partials/cart.html',
        controller:'cartCtrl',
        controllerAs:'cart'
    })
    .otherwise({redirectTo:"/category/0"})


}


