function cartCtrl(products,kart)
{
    console.log("cart")
    var cart=this
    cart.items=kart
    
    console.log(cart.items)

     cart.remove=function(i)
     {
         cart.items.splice(i,1)
         console.log(cart.items)
         cart.total()
     }

     cart.total=function()
     {
         sum=0;
         for(var i=0;i<cart.items.length;i++)
         {
             sum+=kart[i].qty*kart[i].price
         }
         cart.amount=sum
         console.log(cart.amount)
     }
     cart.total()
}


